import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Switch, Route, Link } from 'react-router-dom';
import Home from './Home';
import SobreNos from './SobreNos';
import Fotos from './Fotos';
import Contato from './Contato';
import './util';
import { event } from 'jquery';



class HeaderHome extends React.Component {


  toogleBanner(id) {


    var idPai = document.getElementById('lista');

      if (id == 1) {
        document.getElementById('galeriaBannerId').style.display = "block";

      } else {
        document.getElementById('galeriaBannerId').style.display = "none";
      }




  }

  render() {

    return (

      <div className="App">

        <nav className="navbar navbar-expand-lg navbar-light bg-light" id="menu">

          <button className="navbar-toggler" id="btn-busca-mobile" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>

          <nav className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto sub-menu" id="lista">
              <li className="nav-item active">
                <Link className="nav-link" to="/" exact id="1" onClick={() => this.toogleBanner("1")}><i className="tiny material-icons">home</i> Home <span className="sr-only">(current)</span></Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" id="2" onClick={() => this.toogleBanner("2")} to="/sobre-nos"><i className="tiny material-icons">people</i> Sobre Nós</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/fotos" id="3" onClick={() => this.toogleBanner("3")}><i className="tiny material-icons">collections</i> Fotos</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/fotos" id="4" onClick={() => this.toogleBanner("4")}><i className="tiny material-icons">collections</i> Loja Virtual</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/Contato" id="5" onClick={() => this.toogleBanner("5")}><i className="tiny material-icons">phone</i> Contato</Link>
              </li>
            </ul>

          </nav>
        </nav>

        <div className="all">



          <div className="all-content">
            <Switch>
              <Route exact path="/" component={Home} />
              <Route path="/sobre-nos" component={SobreNos} />
              <Route path="/fotos" component={Fotos} />
              <Route path="/Contato" component={Contato} />
            </Switch>

          </div>






        </div>


      </div>


    )


  }


}






export default HeaderHome;
